import React, { useState } from 'react';
import RetailerOrderRequests from './RetailerOrderRequests';
import RetailerAcceptedOrders from './RetailerAcceptedOrders';
import RetailerOnWayOrders from './RetailerOnWayOrders';

const DistributorOrders = () => {
  const [userType, setUserType] = useState('retailer'); // 'retailer' | 'supplier'
  const [retailerTab, setRetailerTab] = useState('orderRequests'); // sub-tabs for retailer
  const [supplierTab, setSupplierTab] = useState('onWay'); // sub-tabs for supplier

  // Sample data for Supplier tabs
  const supplierOnWayOrders = [
    {
      id: 'ORD123',
      retailer: 'Retailer A',
      items: ['Wheat - Qty: 50kg', 'Rice - Qty: 30kg'],
      expectedDelivery: '2025-06-20',
    },
    {
      id: 'ORD124',
      retailer: 'Retailer B',
      items: ['Sugar - Qty: 20kg'],
      expectedDelivery: '2025-06-21',
    },
    {
      id: 'ORD125',
      retailer: 'Retailer C',
      items: ['Tea - Qty: 10kg', 'Coffee - Qty: 5kg'],
      expectedDelivery: '2025-06-22',
    },
  ];

  const supplierHistoryOrders = [
    {
      id: 'ORD100',
      retailer: 'Retailer X',
      items: ['Salt - Qty: 10kg'],
      deliveredOn: '2025-06-10',
    },
    {
      id: 'ORD101',
      retailer: 'Retailer Y',
      items: ['Oil - Qty: 5L', 'Flour - Qty: 25kg'],
      deliveredOn: '2025-06-12',
    },
    {
      id: 'ORD102',
      retailer: 'Retailer Z',
      items: ['Dal - Qty: 15kg', 'Spices - Qty: 3kg'],
      deliveredOn: '2025-06-14',
    },
  ];

  // Sample data for Retailer tabs
  const orderRequests = [
    {
      retailer: 'Retailer A',
      items: [
        { name: 'Sugar', quantity: 20, rate: 30 },
        { name: 'Salt', quantity: 15, rate: 10 },
      ],
    },
    {
      retailer: 'Retailer B',
      items: [
        { name: 'Oil', quantity: 5, rate: 120 },
      ],
    },
  ];

  const acceptedOrders = [
    {
      retailer: 'Retailer A',
      items: [
        { name: 'Rice', quantity: 25, rate: 50 },
        { name: 'Wheat', quantity: 40, rate: 45 },
      ],
    },
    {
      retailer: 'Retailer B',
      items: [
        { name: 'Tea', quantity: 10, rate: 90 },
      ],
    },
  ];

  const onWayOrders = [
    {
      retailer: 'Retailer A',
      items: [
        { name: 'Spices', quantity: 5, rate: 150 },
      ],
    },
  ];

  return (
    <div className="p-4">
      {/* Toggle between Retailer and Supplier */}
      <div className="mb-6 flex space-x-4">
        <button
          onClick={() => setUserType('retailer')}
          className={`px-4 py-2 rounded-full ${
            userType === 'retailer'
              ? 'bg-blue-600 text-white'
              : 'bg-gray-200 text-gray-700'
          }`}
        >
          Retailer
        </button>
        <button
          onClick={() => setUserType('supplier')}
          className={`px-4 py-2 rounded-full ${
            userType === 'supplier'
              ? 'bg-blue-600 text-white'
              : 'bg-gray-200 text-gray-700'
          }`}
        >
          Supplier
        </button>
      </div>

      {/* Retailer View */}
      {userType === 'retailer' && (
        <>
          {/* Retailer Sub-tabs */}
          <div className="mb-4 flex space-x-4">
            <button
              onClick={() => setRetailerTab('orderRequests')}
              className={`px-3 py-1 rounded ${
                retailerTab === 'orderRequests' ? 'bg-blue-500 text-white' : 'bg-gray-100'
              }`}
            >
              Order Requests
            </button>
            <button
              onClick={() => setRetailerTab('accepted')}
              className={`px-3 py-1 rounded ${
                retailerTab === 'accepted' ? 'bg-blue-500 text-white' : 'bg-gray-100'
              }`}
            >
              Accepted Orders
            </button>
            <button
              onClick={() => setRetailerTab('onWay')}
              className={`px-3 py-1 rounded ${
                retailerTab === 'onWay' ? 'bg-blue-500 text-white' : 'bg-gray-100'
              }`}
            >
              Orders On Way
            </button>
          </div>

          {/* Retailer Content */}
          {retailerTab === 'orderRequests' && <RetailerOrderRequests sampleData={orderRequests} />}
          {retailerTab === 'accepted' && <RetailerAcceptedOrders sampleData={acceptedOrders} />}
          {retailerTab === 'onWay' && <RetailerOnWayOrders sampleData={onWayOrders} />}
        </>
      )}

      {/* Supplier View */}
      {userType === 'supplier' && (
        <>
          {/* Supplier Sub-tabs */}
          <div className="mb-4 flex space-x-4">
            <button
              onClick={() => setSupplierTab('onWay')}
              className={`px-3 py-1 rounded ${
                supplierTab === 'onWay' ? 'bg-green-600 text-white' : 'bg-gray-100'
              }`}
            >
              Orders On Way
            </button>
            <button
              onClick={() => setSupplierTab('history')}
              className={`px-3 py-1 rounded ${
                supplierTab === 'history' ? 'bg-green-600 text-white' : 'bg-gray-100'
              }`}
            >
              History
            </button>
          </div>

          {/* Supplier Content */}
          {supplierTab === 'onWay' && (
            <div className="p-4 bg-green-50 border rounded">
              <h2 className="text-lg font-semibold mb-2">Supplier - Orders On Way</h2>
              <ul className="list-disc pl-6">
                {supplierOnWayOrders.map(order => (
                  <li key={order.id} className="mb-2">
                    <strong>Order ID:</strong> {order.id} — <strong>Retailer:</strong> {order.retailer}<br />
                    <strong>Items:</strong> {order.items.join(', ')}<br />
                    <strong>Expected Delivery:</strong> {order.expectedDelivery}
                  </li>
                ))}
              </ul>
            </div>
          )}

          {supplierTab === 'history' && (
            <div className="p-4 bg-yellow-50 border rounded">
              <h2 className="text-lg font-semibold mb-2">Supplier - History</h2>
              <ul className="list-disc pl-6">
                {supplierHistoryOrders.map(order => (
                  <li key={order.id} className="mb-2">
                    <strong>Order ID:</strong> {order.id} — <strong>Retailer:</strong> {order.retailer}<br />
                    <strong>Items:</strong> {order.items.join(', ')}<br />
                    <strong>Delivered On:</strong> {order.deliveredOn}
                  </li>
                ))}
              </ul>
            </div>
          )}
        </>
      )}
    </div>
  );
};

export default DistributorOrders;
